title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o18030.m1 -> o18029.m16 -> o18030.m0 -> o18029.m16
  o18030.m0 -> o18029.m16 -> o18030.m0
  o18029.m11 -> o18030.m0 -> o18029.m16 -> o18030.m0
  o18029.m16 -> o18030.m0 -> o18029.m16

features:
  - inheritance
  - overriding
  - method
  - polymorphism

